import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import "./css/navigation.css";


const navLinks=[
    {
        title: "Home",
        path: '/'
    },
    {
        title: 'Blog',
        path: '/blog'
    },
    {
        title: 'Contact Us',
        path: '/contact-us'
    }
];

function Navigation(){
    return(
    <div className='navigation-bar'>
    <div className="container">
   <nav className="navbar navbar-expand-md navbar-light d-flex py-3">
    <a className="navbar-brand" href="#">MiniBlog</a>
    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" ariaControls="navbarNavAltMarkup" ariaExpanded="false" ariaLabel="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
      <div className="navbar-nav">
      {
        navLinks.map((link,index)=>{
           return <a key={index} className="nav-item nav-link" href={link.path}>{link.title}</a>
        })
      }
      </div>
      
      <a className="nav-item nav-link my-1">
        <button type="button" className="btn btn-outline-dark me-3">Login</button>
        <button type="button" className="btn btn-dark">Sign Up</button> 
         </a>
    </div>
    
</nav>
</div>
</div>
    )
}

export default Navigation;
